import React, {Component} from 'react';
import "./css/main.css";
import Button from 'react-bootstrap/Button';

class Main extends Component {
    signIn=()=>{
        const nick = this.nick.value;
        alert(nick);
    }
    render(){
        return(
            <div className="container">
                <input placeholder="Nickname" ref={ref=>this.nick=ref} /><br/>
                <input placeholder="E-mail" /><br/>
                <input placeholder="Company" /><br/>
                <input placeholder="Job" /><br/>
                <Button variant="success" onClick={this.signIn}>가입하기</Button>
                <Button variant="warning">다시 생각해보기</Button>
            </div>
        );
    }    
}  

export default Main;
